import React from 'react';
import '../App.css';
import { Przycisk } from './Przycisk';
import './HeroSection.css';
import Cards from './Cards';

export default function HeroSection10({ vehicle }) {
  return (
    <div className='kontener'>
      <video src='/filmy/video1.mp4' autoPlay loop muted />
      <h1>Rezerwacja</h1>

      <Cards vehicles={vehicle} />

      <div className='hero-btns'>
        <Przycisk className='btn' stylPrzycisku='btn--outline' rozmiarPrzycisku='btn--large' linkPrzycisku='/'>
          Strona Główna
        </Przycisk>
        <Przycisk className='btn' stylPrzycisku='btn--outline' rozmiarPrzycisku='btn--large' linkPrzycisku='/Auta'>
          Powrót
        </Przycisk>
        <Przycisk className='btn' stylPrzycisku='btn--outline' rozmiarPrzycisku='btn--large'>
          Wynajmij
        </Przycisk>
      </div>
    </div>
  );
}
